  false,\n\t\"url\": null,\n\t\"notes\": \"Initial survey instructions for 1.04 spring
  water monitoring (quality) and 1.06 management unit water monitoring (quality) at
  Fish Springs National Wildlife Refuge.  Water quality measurements, conductivity
  (u00b5S/cm), salinity (ppm), pH and temperature (u00b0C), are taken monthly with
  a handheld YSI meter (Environmental Model 556). As of January 2015, measurements
  are taken at a series of 27-establish sites located within the permanently flooded
  springs as well as the semi-permanently flooded and seasonally flooded wetland management
  units.  The datasheet used for this monitoring is included in this record.\",\n\t\"license_title\":
